import React from "react";
import information from "./information.json";
import { Routes, Route, useParams } from 'react-router-dom';
import Card from "./components/Card";
import { useDetectAdBlock } from "adblock-detect-react";


const Page = () => {
  const { id } = useParams();
  return <div>
    <div className="wrapper">
      <iframe title={id} width="960" height="540" src={`//mixdrop.co/e/${id}`} frameborder="0" allowfullscreen="true"></iframe>
    </div>
    <Grid />
  </div>
}


const Grid = () => {
  return <div className="grid-row">{information.files.map(data => <Card data={data}></Card>)}</div>
}

function App() {
  const adBlockDetected = useDetectAdBlock();

  return <>{
    !adBlockDetected ? <>
      <Routes path="react-tube-main">
        <Route path="/" element={<Grid />} />
        <Route path="/page/:id" element={<Page />} />
      </Routes>
    </> : <div style={{color:"black", margin:"auto"}}>ad block detected, allow ads to use this site</div>
  }</>
}

export default App;
